description:
Score for Alfred Hitchcock&amp;#039;s Rebecca composed by Franz Waxman, performed by Joel McNeely &amp; The Royal Scottish National Orchestra, released by Varese Sarabande

Bitrate: 160 

From the liner notes: &quot;...features some of the most sumptuous and ravishing music ever composed for the screen. It is also, at turns, ghostly and disembodied, hauntingly and violently dramatic.&quot; 

&quot;Hearing a score one knows largely from a 1940 mono film mix, all of a sudden opened up by the full symphonic forces of the Royal Scottish National Orchestra, proved an astounding revelation.&quot;
